export const  questions = [
    {
        id :1,
        question:"What is the virtual DOM?",
        answer:"DOM stands for Document Object Model, The DOM represents an HTML document with a logical tree structure."
    },
    {
        id :2,
        question:"How do you create a React app?",
        answer:"Install the create-react-app package using the command prompt or terminal"
    },
    {
        id :3,
        question:"What is an event in React?",
        answer:"An event is an action that a user or system may trigger, such as pressing a key, a mouse click, etc."
    },
    {
        id :4,
        question:"What is synthetic events in React?",
        answer:"A synthetic event is fired by an event rule in the same way that an event rule can fire an action. Another event rule can then respond to the fired synthetic event."
    },
    {
        id :5,
        question:"What are the components in React?",
        answer:"Components are the building blocks of React applications. They are independent and reusable bits of code that can be combined to create complex UIs. Components can be nested within other components, and they can be passed data as props."
    }    
